{
  var tdElem = document.createElement('td');
  with(tdElem.style)
  {
    padding='2px';
    margin='0px';     
    width='15px';
    border=isEmpty?'none':'solid 1px #ad4a28';
    font='12pt Tibetan Machine Uni';
    textAlign='center';
    background='white';
  }                             
  if(!isEmpty)
  {
    tdElem.innerHTML = ch;
    var attr = document.createAttribute('o');
    attr.value = ch;
    tdElem.attributes.setNamedItem(attr);

    var attr = document.createAttribute('t');
    attr.value = title;
    tdElem.attributes.setNamedItem(attr);
      
    tdElem.onmouseover = function() { this.style.background = 'DarkOrange'; TibetanEWTS_ShowPreview(this); return false; }
    tdElem.onmouseout = function(e) { this.style.background = 'White'; TibetanEWTS_HidePreview(this); return false; }
    tdElem.onclick = function(e) { KeymanWeb.KT(this.attributes['o'].value); if(!e)e=window.event;if(e) e.cancelBubble=true; }
    tdElem.onmousedown = function(e) { KeymanWeb.KSF(); if(!e)e=window.event;if(e) e.cancelBubble=true; }
  }
  return tdElem;
}    

window.TibetanEWTS_ShowPreview = function(e)
{
  with(TibetanEWTS_PreviewCell)
  {
    innerHTML = 
        "<div style='background:LightSteelBlue; border-bottom:1px solid SlateGray'>"+e.innerHTML+"</div>"+
        "<div style='padding: 2px 4px; font: 8pt Tahoma;'>"+e.attributes['t'].value+'</div>';
    style.background = 'white'; //e.style.background;
    style.display='block';
    style.left = (KeymanWeb.GetAbsoluteX(e)+2)+'px';
    style.top = (KeymanWeb.GetAbsoluteY(e)+e.offsetHeight+2)+'px';
  }
}

window.TibetanEWTS_HidePreview = function(e)
{
  TibetanEWTS_PreviewCell.style.display='none';
}

this.KHF=function(e) { 
  if(!e) { alert("Could not construct Tibetan EWTS keyboard"); return; }
  if (typeof e.onselectstart!="undefined") //IE route
    e.onselectstart=function(){return false;};
  else
  {
    e.style.MozUserSelect="none";
    e.style.KhtmlUserSelect="none";
    e.style.UserSelect="none";
  }        
  
  var divElem = window.TibetanEWTS_PreviewCell = document.createElement('div');
  with(divElem.style)
  {
    display='none';
    position='absolute';   
    border='1px solid SlateGray';
    zIndex=1001;
    font='24pt Tibetan Machine Uni';
    textAlign='center';
  }

  var Tibetan_Marks = [
    { desc: 'Logotype Signs', chars : [
        { ch: '༕', desc: 'Chad Rtags' },
        { ch: '༖', desc: 'Lhag Rtags' }
    ] },
    { desc: 'Astrological Signs', chars : [ 
        { ch: '༗', desc: 'Sgra Gcan-Char Rtags' },
        { ch: '༘', desc: '-Khyud Pa' },
        { ch: '༙', desc: 'Sdong Tshugs' },
        { ch: '༾', desc: 'Yar Tshes' },
        { ch: '༿', desc: 'Mar Tshes' },
        { ch: '࿏', desc: 'Rdel Nag Gsum' }
    ] },
    { desc: 'Half Digits', chars : [ 
        { ch: '༪', desc: 'Half 1' },
        { ch: '༫', desc: 'Half 2' },
        { ch: '༬', desc: 'Half 3' },
        { ch: '༭', desc: 'Half 4' },
        { ch: '༮', desc: 'Half 5' },
        { ch: '༯', desc: 'Half 6' },
        { ch: '༰', desc: 'Half 7' },
        { ch: '༱', desc: 'Half 8' },
        { ch: '༲', desc: 'Half 9' },
        { ch: '༳', desc: 'Half 0' }
    ] },
    { desc: 'Cantillation Signs', chars : [ 
        { ch: '࿀', desc: 'Heavy Beat' },
        { ch: '࿁', desc: 'Light Beat' },
        { ch: '࿂', desc: 'Cang Te-U' },
        { ch: '࿃', desc: 'Sbub -Chal' } 
    ] },
    { desc: 'Symbols', chars : [ 
        { ch: '࿄', desc: 'Dril Bu' },
        { ch: '࿅', desc: 'Rdo Rje' },
        { ch: '࿆', desc: 'Padma Gdan' },
        { ch: '࿇', desc: 'Rdo Rje Rgya Gram' },
        { ch: '࿈', desc: 'Phur Pa' },
        { ch: '࿉', desc: 'Nor Bu' },
        { ch: '࿊', desc: 'Nor Bu Nyis -Khyil' },
        { ch: '࿋', desc: 'Nor Bu Gsum -Khyil' },
        { ch: '࿌', desc: 'Nor Bu Bzhi -Khyil' }
    ] } ];

  var tElem = document.createElement('table');
  with(tElem.style)
  {
    margin = 0;      
    borderCollapse='collapse';
  }
  
  var tbodyElem = document.createElement('tbody');
  maxcol = 0;
  for(var row = 0; row < Tibetan_Marks.length; row++)
    maxcol = (Tibetan_Marks[row].chars.length > maxcol ? Tibetan_Marks[row].chars.length : maxcol);
    
  for(var row = 0; row < Tibetan_Marks.length; row++)
  {
    var trElem = document.createElement('tr');
    var thElem = document.createElement('th');
    thElem.innerHTML = Tibetan_Marks[row].desc;
    trElem.appendChild(thElem);
    for(var col = 0; col < maxcol; col++)
    {                                               
      var empty = (col >= Tibetan_Marks[row].chars.length);
      var tdElem = this.KHF_CreateCell(empty, empty?'':Tibetan_Marks[row].chars[col].ch, empty?'':Tibetan_Marks[row].chars[col].desc);
      trElem.appendChild(tdElem);
    }
    tbodyElem.appendChild(trElem);
  }            
  
  tElem.appendChild(tbodyElem);             
  with(document.getElementById('keyboard_tibetan_ewts_to_unicode_help'))
  {
    appendChild(tElem);
  } 
  document.body.appendChild(divElem);

  e.onclick=function() { KeymanWeb.KT(''); return false; }
  e.onmousedown=function() { KeymanWeb.KSF(); return false; }
}
